import styled from 'styled-components';

const Ancor = styled.a`
    margin-right: 15px;
    text-decoration: underline;
    cursor: pointer;
    font-size: 1.2em;
    color: blue;
    &:visited {
        color: blueviolet;
    }
`;

export default Ancor;
